import React from 'react'
import { RiCheckboxBlankCircleFill } from "react-icons/ri";
import { Button } from '../../components';


const Card = ({ himage, title , date }) => {
    return (
        <div className='la__popular--card'>
            <div className="la__popular--card_img">
                <img src={himage} alt="header" />
            </div>
            <div className="la__popular--card_body">
                <em><RiCheckboxBlankCircleFill className="text=primary"/> {date}</em>
               <h5>{title}</h5>
                <div className='d-flex align-items-center justify-content-between my-3'>
                    <Button classes="btnsm" text="Book Now" />       
                </div>
            </div>
        </div>
    )
}

export default Card
